import React, { useState } from "react";
import MyButton from "./Components/Button";
import Items from "./Components/Items";
import {Container} from "./Components/Styles/ContainerApp.styled"

const App = () => {
  const [myData, setMyData] = useState([]);
  const [isClicked, setIsClicked] = useState(false);

  const parsedDataHandler = (parsedData) => {
    setMyData(parsedData);
    setIsClicked(true);
  }

  return (
    <div>
      <MyButton parsedData={parsedDataHandler}/>
      {isClicked && <Items data={myData}/>}
    </div>
  );
};

export default App;
